pub fn decode_html_ref(
    ctx: HtmlContext,
    input: &[u8],
    offset: usize,
) -> Option<(Box<[u8]>, usize)> {
    //gen_entities::entities_map!("crates/entities/data/entities.json");

    if input.len() < offset + 3 {
        return None;
    }

    if input[offset] != b'&' {
        return None;
    }

    if input[offset + 1] == b'#' {
        return decode_html5_numeric_character_reference(input, offset);
    }

    let s = String::from_utf8_lossy(&input[offset..]);
    //dbg!(&s);

    if input.len() > 3 + offset {
        if let Some(group_number) = html5_find_large_reference_name_group(input, offset + 1) {
            //dbg!(&group_number);
            if let Some((replacement, matched_byte_length)) =
                html5_find_large_reference_name(input, offset + 1, group_number)
            {
                let last_of_match = offset + matched_byte_length;
                let is_ambiguous = last_of_match < input.len()
                    && html5_character_reference_is_ambiguous(&input[last_of_match..]);

                //if ((PHP_HTML_DECODE_AMBIGUOUS_AMPERSAND & ~flags) && is_ambiguous) {
                //    goto html5_find_short_reference;
                //}
                //
                //(*matched_byte_length)++;
                return Some((replacement, matched_byte_length + 1));
            }
        }
    }

    // Try a small word.
    let matched = html5_find_short_reference_name(input, offset + 1)?;
    Some(([matched].into(), 3))

    //if (
    //    (PHP_HTML_DECODE_AMBIGUOUS_AMPERSAND & ~flags) &&
    //    offset + 3 < input_length &&
    //    html5_character_reference_is_ambiguous(&input[offset + 2])
    //) {
    //    return NULL;
    //}
}

